import React, { useState } from "react";
import './Styles/App.css';
import { BrowserRouter } from "react-router-dom"
import Menu from "./Components/Menu/index"
import RoutesWeb from "./Components/RoutesWeb/RoutesWeb"
import firebase from "firebase";

const firebaseConfig = {
  apiKey: "AIzaSyAikUWiRBzu132xGlhgnqhLjmt7WprUf0k",
  authDomain: "ecommerce-b48f0.firebaseapp.com",
  projectId: "ecommerce-b48f0",
  storageBucket: "ecommerce-b48f0.appspot.com",
  messagingSenderId: "97314139701",
  appId: "1:97314139701:web:028ebb5c43be9d8f320b7c"
};
// Initialize Firebase
firebase.initializeApp(firebaseConfig);

function App() {
  console.log(firebase.database());
  const [opciones] = useState([
    {
      path: "/",
      label: "Home"
    },
    {
      path: "/login",
      label: "Login"
    },
    {
      path: "/registro",
      label: "Registrarse"
    }
  ]
  )

  return (
    <BrowserRouter>
      <Menu data={opciones} />
      <RoutesWeb />
    </BrowserRouter>
  );
}

export default App;
